import React from 'react';
import './process.css'; // Import the CSS file for styling


const Process = () => {
  return (
    <div className="background-page">
      <div className="container">
      <h1 className="heading">Our Process Is Simple</h1>
      <p className="description">
      We are a team of experts dedicated to simplifying all phases of our projects, we strive to reimagine traditional spaces to create purpose-driven, yet adaptable environments that engage the user.


      </p>
      <button className="cta-button">Our Services</button>
    </div>
      </div>
 
  );
};

export default Process;
